import React, { useState, useEffect } from "react";
import axios from "axios";

const CustomerDashboard = () => {
  const [userData, setUserData] = useState({});

  useEffect(() => {
    const email = localStorage.getItem("citizenEmail"); // get email from login
    if (!email) return;

    axios
      .get(`http://localhost:8081/Complaint-chain/api/auth/citizen?email=${email}`)
      .then((res) => setUserData(res.data))
      .catch((err) => console.error("Error fetching citizen data:", err));
  }, []);

  return (
    <div>
      <h3>Dashboard</h3>
      {userData.email ? (
        <div>
          <p><strong>Name:</strong> {userData.firstName} {userData.lastName}</p>
          <p><strong>Email:</strong> {userData.email}</p>
          <p><strong>Phone:</strong> {userData.phone}</p>
          <p><strong>NIC:</strong> {userData.nic}</p>
        </div>
      ) : (
        <p>Loading citizen data...</p>
      )}
    </div>
  );
};

export default CustomerDashboard;
